import React from "react";

const AboutPage = () => {
  return (
    <div>
      <section class="sub-header">
        <nav>
          <a href="about.html">
            <img src="./landingpage_img/logo.png" />
          </a>
        </nav>
        <h1>About Us</h1>
      </section>
    </div>
  );
};

export default AboutPage;
